    {
      name: "Basic Package",
      price: "$20",
      features: ["Basic Marker", "50 Paintballs"],
    },
    {
      name: "Standard Package",
      price: "$35",
      features: ["Upgraded Marker", "100 Paintballs", "Safety Gear"],
    },
    {
      name: "Premium Package",
      price: "$50",
      features: ["Premium Marker", "200 Paintballs", "Safety Gear", "Snacks"],
    },
  ];

  return (
    <div className="container mt-5">
      {" "}
      <PageHeader title={<h1 className="text-center mb-4">Paintball Packages</h1>} />
      <BasicPackages packages={ [
    {
      name: "Basic Package",
      price: "$20",
      features: ["Basic Marker", "50 Paintballs"],
    },
    {
      name: "Standard Package",
      price: "$35",
      features: ["Upgraded Marker", "100 Paintballs", "Safety Gear"],
    },
    {
      name: "Premium Package",
      price: "$50",
      features: ["Premium Marker", "200 Paintballs", "Safety Gear", "Snacks"],
    },
  ]
}/>
    </div>
  );
};

export default PaintballPage;
